import './App.css';
import profile from './images/profile-1x.png';

function App() {
  return (
    <div className="card--container container">
      <div className="card--profile">
        <section className="card--hero-banner">
          <img src={profile} className="App-logo" alt="logo" />
        </section>
        <section className="card--info">
          <div className="card--profile-info-name">Laura Smith</div>
          <div className="card--profile-info-title"> Frontend Developer </div>
          <div className="card--profile-info-website"> laurasmith.website </div>
        </section>
      </div>
    </div>
  );
}

export default App;
